import{_ as i}from"./plugin-vue_export-helper.21dcd24c.js";import{o as e,c as s,d as a}from"./app.a2583bd1.js";const r={},n=a('<h1 id="redis-\u9762\u8BD5\u7A81\u51FB" tabindex="-1"><a class="header-anchor" href="#redis-\u9762\u8BD5\u7A81\u51FB" aria-hidden="true">#</a> Redis \u9762\u8BD5\u7A81\u51FB</h1><h2 id="redis-\u662F\u4EC0\u4E48" tabindex="-1"><a class="header-anchor" href="#redis-\u662F\u4EC0\u4E48" aria-hidden="true">#</a> Redis \u662F\u4EC0\u4E48</h2><p>Redis \u662F\u4E00\u4E2A\u57FA\u4E8E\u5185\u5B58\u7684\u6570\u636E\u5E93\uFF0C\u5176\u5BF9\u6570\u636E\u7684\u8BFB\u5199\u90FD\u662F\u5728\u5185\u5B58\u4E2D\u5B8C\u6210\u7684\uFF0C\u56E0\u6B64\u8BFB\u5199\u901F\u5EA6\u975E\u5E38\u5FEB\uFF0C\u5E38\u7528\u4E8E\u7F13\u5B58\u3001\u6D88\u606F\u961F\u5217\u3001\u5206\u5E03\u5F0F\u9501\u7B49</p><p>Redis \u63D0\u4F9B\u4E86\u591A\u79CD\u6570\u636E\u7C7B\u578B\u6765\u652F\u6301\u4E0D\u540C\u7684\u4E1A\u52A1\u573A\u666F\uFF0C\u6BD4\u5982 String(\u5B57\u7B26\u4E32)\u3001Hash(\u54C8\u5E0C)\u3001List (\u5217\u8868)\u3001Set(\u96C6\u5408)\u3001Zset(\u6709\u5E8F\u96C6\u5408)\u3001Bitmaps\uFF08\u4F4D\u56FE\uFF09\u3001HyperLogLog\uFF08\u57FA\u6570\u7EDF\u8BA1\uFF09\u3001GEO\uFF08\u5730\u7406\u4FE1\u606F\uFF09\u3001Stream\uFF08\u6D41\uFF09\uFF0C\u5E76\u4E14\u5BF9\u6570\u636E\u7C7B\u578B\u7684\u64CD\u4F5C\u90FD\u662F<strong>\u539F\u5B50\u6027</strong>\u7684\uFF0C\u56E0\u4E3A\u6267\u884C\u547D\u4EE4\u7531\u5355\u7EBF\u7A0B\u8D1F\u8D23\u7684\uFF0C\u4E0D\u5B58\u5728\u5E76\u53D1\u7ADE\u4E89\u7684\u95EE\u9898\u3002</p><p>\u9664\u6B64\u4E4B\u5916\uFF0CRedis \u8FD8\u652F\u6301<strong>\u4E8B\u52A1 \u3001\u6301\u4E45\u5316\u3001Lua \u811A\u672C\u3001\u591A\u79CD\u96C6\u7FA4\u65B9\u6848\uFF08\u4E3B\u4ECE\u590D\u5236\u3001\u54E8\u5175\uFF09\u3001\u5185\u5B58\u6DD8\u6C70\u673A\u5236</strong></p><h2 id="\u4E3A\u4EC0\u4E48\u9009\u62E9-redis-\u4F5C\u4E3A-mysql-\u7684\u7F13\u5B58" tabindex="-1"><a class="header-anchor" href="#\u4E3A\u4EC0\u4E48\u9009\u62E9-redis-\u4F5C\u4E3A-mysql-\u7684\u7F13\u5B58" aria-hidden="true">#</a> \u4E3A\u4EC0\u4E48\u9009\u62E9 Redis \u4F5C\u4E3A MySQL \u7684\u7F13\u5B58</h2><p>\u6700\u4E3B\u8981\u7684\u539F\u56E0\u662F\uFF1A<strong>\u9AD8\u6027\u80FD\u3001\u9AD8\u5E76\u53D1</strong></p><ul><li>\u9AD8\u6027\u80FD\uFF1A\u7528\u6237\u7B2C\u4E00\u6B21\u8BBF\u95EE MySQL \u4E2D\u7684\u6570\u636E\uFF0C\u8FD9\u4E2A\u8FC7\u7A0B\u53EF\u80FD\u6BD4\u8F83\u6162\uFF0C\u56E0\u4E3A\u6570\u636E\u9700\u8981\u4ECE\u78C1\u76D8\u4E0A\u8BFB\u53D6\uFF1B\u5047\u5982\u628A\u8FD9\u4E9B\u4ECE MySQL \u8BFB\u53D6\u51FA\u6765\u7684\u6570\u636E\u653E\u5230 Redis \u4E2D\uFF0C\u8FD9\u6837\u4E0B\u4E00\u6B21\u8BBF\u95EE\u5C31\u662F\u76F4\u63A5\u8BFB\u53D6\u5185\u5B58\u4E2D\u7684\u6570\u636E\u4E86\uFF0C\u901F\u5EA6\u975E\u5E38\u5FEB\u3002\u5982\u679C MySQL \u4E2D\u7684\u6570\u636E\u6709\u6539\u53D8\uFF0C\u90A3\u4E48\u4E5F\u9700\u8981\u540C\u6B65\u4FEE\u6539 Redis \u4E2D\u7684\u6570\u636E\uFF0C\u8FD9\u91CC\u4F1A\u6D89\u53CA\u5230 MySQL \u548C Redis \u53CC\u5199\u4E00\u81F4\u6027\u7684\u95EE\u9898</li><li>\u9AD8\u5E76\u53D1\uFF1A\u5355\u673A MySQL \u7684 QPS \u4E00\u822C\u6765\u8BF4\u6700\u9AD8\u5728 1w \u5DE6\u53F3\uFF0C\u800C\u5355\u673A Redis \u7684 QPS \u53EF\u4EE5\u6BD4\u8F83\u8F7B\u677E\u5730\u7A81\u7834 10w\uFF0C\u6240\u4EE5\u76F4\u63A5\u8BBF\u95EE Redis \u80FD\u5904\u7406\u7684\u8BF7\u6C42\u6570\u91CF\u662F\u8FDC\u5927\u4E8E\u76F4\u63A5\u8BBF\u95EE MySQL \u7684\uFF0C\u6240\u4EE5\u53EF\u4EE5\u8003\u8651\u628A\u4E00\u90E8\u5206\u6570\u636E\u653E\u5230 Redis \u4E2D\uFF0C\u8FD9\u6837\u9700\u8981\u8BBF\u95EE\u8FD9\u4E9B\u6570\u636E\u7684\u8BF7\u6C42\u5C31\u53EF\u4EE5\u76F4\u63A5\u8BBF\u95EE Redis \u800C\u4E0D\u7528\u8BBF\u95EE MySQL</li></ul><h2 id="redis-\u7684\u6570\u636E\u7C7B\u578B\u53CA\u5176\u4F7F\u7528\u573A\u666F" tabindex="-1"><a class="header-anchor" href="#redis-\u7684\u6570\u636E\u7C7B\u578B\u53CA\u5176\u4F7F\u7528\u573A\u666F" aria-hidden="true">#</a> Redis \u7684\u6570\u636E\u7C7B\u578B\u53CA\u5176\u4F7F\u7528\u573A\u666F</h2><h3 id="string-\u5B57\u7B26\u4E32" tabindex="-1"><a class="header-anchor" href="#string-\u5B57\u7B26\u4E32" aria-hidden="true">#</a> String \u5B57\u7B26\u4E32</h3><p>String \u53EF\u4EE5\u5B58\u50A8\u5B57\u7B26\u4E32\uFF0C\u5E76\u9488\u5BF9\u5B57\u7B26\u4E32\u505A\u4E00\u5B9A\u64CD\u4F5C\uFF1B\u8FD8\u53EF\u4EE5\u5B58\u50A8\u6574\u578B\u3001\u6D6E\u70B9\u578B\u6570\u636E\uFF0C\u5E76\u9488\u5BF9\u5B83\u4EEC\u505A\u81EA\u589E\u6216\u81EA\u51CF\u7684\u64CD\u4F5C</p><p>\u5E95\u5C42<strong>\u4F7F\u7528 SDS \u7B80\u5355\u52A8\u6001\u5B57\u7B26\u4E32</strong>\u6765\u5B9E\u73B0\uFF0CSDS \u6709\u4EE5\u4E0B\u7279\u70B9\uFF1A</p><p><img src="https://wingbun-notes-image.oss-cn-guangzhou.aliyuncs.com/images/20230602175402.png" alt=""></p><ul><li>SDS \u4E0D\u4EC5\u53EF\u4EE5\u4FDD\u5B58\u5B57\u7B26\u4E32\uFF0C\u8FD8\u53EF\u4EE5\u4FDD\u5B58\u4E8C\u8FDB\u5236\u6570\u636E</li><li>SDS \u7EF4\u62A4\u4E86\u4E00\u4E2A len \u5C5E\u6027\u8BB0\u5F55\u4E86\u5B57\u7B26\u4E32\u957F\u5EA6\uFF0C\u83B7\u53D6\u5B57\u7B26\u4E32\u957F\u5EA6\u7684\u65F6\u95F4\u590D\u6742\u5EA6\u4E3A O(1)</li><li>SDS \u5728\u62FC\u63A5\u5B57\u7B26\u4E32\u524D\u4F1A\u505A\u7A7A\u95F4\u68C0\u67E5\uFF0C\u5982\u679C\u7A7A\u95F4\u4E0D\u8DB3\u4F1A\u81EA\u52A8\u6269\u5BB9\uFF0C\u62FC\u63A5\u5B57\u7B26\u4E32\u4E0D\u4F1A\u9020\u6210\u7F13\u51B2\u533A\u6EA2\u51FA\uFF0C\u4FDD\u8BC1 API \u4F7F\u7528\u5B89\u5168</li></ul><p>\u4F7F\u7528\u573A\u666F\uFF1A</p><ul><li>\u7F13\u5B58\u5E38\u89C4\u6570\u636E\uFF1A\u5982 session \u4FE1\u606F\u3001\u5E8F\u5217\u5316\u540E\u7684\u5BF9\u8C61\u7B49</li><li>\u8BA1\u6570\u573A\u666F\uFF1A\u5355\u4F4D\u65F6\u95F4\u8BBF\u95EE\u6570\u7B49</li><li><strong>\u5206\u5E03\u5F0F\u9501</strong>\uFF0C\u53EF\u4EE5\u4F7F\u7528 <code>SETNX KEY VALUE</code> \u7B80\u5355\u5B9E\u73B0\uFF0C\u4F46\u662F\u5BF9\u4E8E\u91CA\u653E\u9501\u4F1A\u6709\u7F3A\u9677</li></ul><h3 id="list-\u5217\u8868" tabindex="-1"><a class="header-anchor" href="#list-\u5217\u8868" aria-hidden="true">#</a> List \u5217\u8868</h3><p>List \u662F\u4E00\u4E2A\u94FE\u8868\u7ED3\u6784\uFF0C\u94FE\u8868\u4E0A\u6BCF\u4E00\u4E2A\u8282\u70B9\u90FD\u53EF\u4EE5\u5B58\u50A8 String \u7C7B\u578B\u7684\u6570\u636E\uFF0C\u53EF\u4EE5\u5BF9\u94FE\u8868\u4E24\u7AEF\u8FDB\u884C push\u3001pop \u64CD\u4F5C</p><p>3.2 \u7248\u672C\u540E\u5E95\u5C42\u662F\u4F7F\u7528 QuickList \u6765\u5B9E\u73B0\uFF0C\u4E4B\u524D\u7684\u7248\u672C\u662F\u7528\u538B\u7F29\u5217\u8868\uFF08\u5143\u7D20\u5C11\u4E8E 512 \u4E2A\uFF0C\u5143\u7D20\u5927\u5C0F\u5C0F\u4E8E 64 \u5B57\u8282\uFF09\u6216\u53CC\u5411\u94FE\u8868\u5171\u540C\u5B9E\u73B0\u7684</p><p>\u4F7F\u7528\u573A\u666F\uFF1A</p><ul><li><strong>\u4FE1\u606F\u6D41\u5C55\u793A</strong>\uFF0C\u6700\u65B0\u7684\u52A8\u6001</li><li><strong>\u6D88\u606F\u961F\u5217</strong>\uFF0C\u4F46\u662F\u5BF9\u6D88\u606F\u4E22\u5931\u3001\u6D88\u606F\u5806\u79EF\u5904\u7406\u65B9\u9762\u5B58\u5728\u4E0D\u8DB3</li></ul><h3 id="\u538B\u7F29\u5217\u8868" tabindex="-1"><a class="header-anchor" href="#\u538B\u7F29\u5217\u8868" aria-hidden="true">#</a> \u538B\u7F29\u5217\u8868</h3><p>\u538B\u7F29\u5217\u8868\u4E3A\u4E86\u8282\u7EA6\u5185\u5B58\u800C\u5F00\u53D1\u7684\uFF0C\u5B83\u662F<strong>\u7531\u8FDE\u7EED\u5185\u5B58\u5757\u7EC4\u6210\u7684\u987A\u5E8F\u578B\u6570\u636E\u7ED3\u6784</strong>\uFF0C\u6709\u70B9\u7C7B\u4F3C\u4E8E\u6570\u7EC4\uFF0C\u538B\u7F29\u5217\u8868\u4E0A\u6709 4\u3002\u4E2A\u56FA\u5B9A\u7684\u5B57\u6BB5\uFF1A</p><ul><li><strong>zlbytes</strong>\uFF0C\u8BB0\u5F55\u6574\u4E2A\u538B\u7F29\u5217\u8868\u5360\u7528\u5BF9\u5185\u5B58\u5B57\u8282\u6570\uFF1B</li><li><strong>zltail</strong>\uFF0C\u8BB0\u5F55\u538B\u7F29\u5217\u8868\u300C\u5C3E\u90E8\u300D\u8282\u70B9\u8DDD\u79BB\u8D77\u59CB\u5730\u5740\u7531\u591A\u5C11\u5B57\u8282\uFF0C\u4E5F\u5C31\u662F\u5217\u8868\u5C3E\u7684\u504F\u79FB\u91CF\uFF1B</li><li><strong>zllen</strong>\uFF0C\u8BB0\u5F55\u538B\u7F29\u5217\u8868\u5305\u542B\u7684\u8282\u70B9\u6570\u91CF\uFF1B</li><li><strong>zlend</strong>\uFF0C\u6807\u8BB0\u538B\u7F29\u5217\u8868\u7684\u7ED3\u675F\u70B9\uFF0C\u56FA\u5B9A\u503C 0xFF\uFF08\u5341\u8FDB\u5236255\uFF09\u3002</li></ul><p>\u4F7F\u5F97\u67E5\u8BE2\u7B2C\u4E00\u4E2A\u3001\u6700\u540E\u4E00\u4E2A\u5143\u7D20\u65F6\u6548\u7387\u975E\u5E38\u9AD8\u6548\uFF0C\u4F46\u662F\u67E5\u8BE2\u5176\u4ED6\u5143\u7D20\u5C31\u8FD8\u662F\u9700\u8981\u904D\u5386\u67E5\u8BE2\uFF0C\u56E0\u6B64\u4E0D\u9002\u5408\u5B58\u653E\u8FC7\u591A\u5143\u7D20</p><p><img src="https://wingbun-notes-image.oss-cn-guangzhou.aliyuncs.com/images/20230602210722.png" alt=""></p><h3 id="listpack" tabindex="-1"><a class="header-anchor" href="#listpack" aria-hidden="true">#</a> ListPack</h3><p>ListPack \u5438\u6536\u4E86\u538B\u7F29\u5217\u8868\u5F88\u591A\u4F18\u70B9\uFF0C\u6BD4\u5982\u7528\u4E00\u5757\u8FDE\u7EED\u7684\u5185\u5B58\u7A7A\u95F4\uFF0C\u6BD4\u8F83\u4E3B\u8981\u7684\u4E0D\u540C\u662F\u8282\u70B9\u6570\u636E\u4E0D\u518D\u7EF4\u62A4\u4E0A\u4E00\u4E2A\u8282\u70B9\u7684\u957F\u5EA6\uFF0C\u8FD9\u6837\u53EF\u4EE5<strong>\u907F\u514D\u5176\u4ED6\u8282\u70B9\u7684\u957F\u5EA6\u53D8\u5316\u65F6\u5F15\u8D77\u7684\u8FDE\u9501\u66F4\u65B0</strong></p><p><img src="https://wingbun-notes-image.oss-cn-guangzhou.aliyuncs.com/images/20230602214014.png" alt=""></p><h3 id="quicklist" tabindex="-1"><a class="header-anchor" href="#quicklist" aria-hidden="true">#</a> QuickList</h3><p><strong>QuickList \u5B9E\u9645\u4E0A\u662F\u538B\u7F29\u5217\u8868\u548C\u53CC\u5411\u94FE\u8868\u7684\u6DF7\u5408\u4F53</strong>\uFF0C\u5B83\u5C06\u53CC\u5411\u94FE\u8868\u6309\u6BB5\u5207\u5206\uFF0C\u6BCF\u4E00\u6BB5\u4F7F\u7528\u538B\u7F29\u5217\u8868\u6765\u7D27\u51D1\u5B58\u50A8\uFF0C\u591A\u4E2A\u538B\u7F29\u5217\u8868\u4E4B\u95F4\u4F7F\u7528\u53CC\u5411\u6307\u9488\u4E32\u63A5\u8D77\u6765</p><p><img src="https://wingbun-notes-image.oss-cn-guangzhou.aliyuncs.com/images/20230602171833.png" alt=""></p><h3 id="hash-\u54C8\u5E0C" tabindex="-1"><a class="header-anchor" href="#hash-\u54C8\u5E0C" aria-hidden="true">#</a> Hash \u54C8\u5E0C</h3><p>Hash \u662F\u4E00\u4E2A String \u7C7B\u578B\u7684\u952E\u503C\u5BF9\u6620\u5C04\u8868\uFF0C\u7C7B\u4F3C\u4E8E Java \u4E2D HashMap\uFF0C\u5F53\u53D1\u751F\u54C8\u5E0C\u51B2\u7A81\u65F6\uFF0C\u548C HashMap \u4E00\u6837\uFF0C\u4E5F\u662F\u4F7F\u7528\u94FE\u5F0F\u54C8\u5E0C\u7684\u65B9\u5F0F\u89E3\u51B3\uFF1B\u54C8\u5E0C\u8868\u6269\u5BB9\u65F6\u662F<strong>\u4F7F\u7528\u6E10\u8FDB\u5F0F rehash \u7684\u65B9\u5F0F\u6269\u5BB9</strong>\u7684\uFF0C\u6BCF\u6B21\u5BF9\u5143\u7D20\u8FDB\u884C\u64CD\u4F5C\u65F6\u4F1A\u987A\u5E8F\u5C06 Hash1 \u4E0A\u5BF9\u5E94\u7D22\u5F15\u7684\u5143\u7D20 \u8FC1\u79FB\u5230 Hash2 \u4E0A</p><p>\u5E95\u5C42\u4F7F\u7528\u538B\u7F29\u5217\u8868\uFF08\u5143\u7D20\u5C11\u4E8E 512 \u4E2A\uFF0C\u5143\u7D20\u5927\u5C0F\u5C0F\u4E8E 64 \u5B57\u8282\uFF09\u6216\u54C8\u5E0C\u8868\u6765\u5B9E\u73B0</p><p>\u4F7F\u7528\u573A\u666F\uFF1A</p><ul><li>\u7F13\u5B58\u5BF9\u8C61\u6570\u636E</li><li><strong>\u5B58\u50A8\u8D2D\u7269\u8F66\u4FE1\u606F</strong>\uFF0Ckey \u4E3A\u7528\u6237 id\uFF0Cfield \u4E3A\u5546\u54C1 id\uFF0Cvalue \u4E3A\u5546\u54C1\u6570\u91CF</li></ul><h3 id="set-\u96C6\u5408" tabindex="-1"><a class="header-anchor" href="#set-\u96C6\u5408" aria-hidden="true">#</a> Set \u96C6\u5408</h3><p>Set \u662F\u4E00\u4E2A\u5305\u542B\u5B57\u7B26\u4E32\u7684\u65E0\u5E8F\u96C6\u5408\uFF0C\u96C6\u5408\u4E2D\u7684\u5143\u7D20\u6CA1\u6709\u987A\u5E8F\u4F46\u662F\u80FD\u4FDD\u8BC1\u552F\u4E00\uFF0C\u6709\u70B9\u7C7B\u4F3C Java \u4E2D\u7684 HashSet \u96C6\u5408</p><p>\u5E95\u5C42\u4F7F\u7528\u6574\u6570\u96C6\u5408\uFF08\u5143\u7D20\u5C11\u4E8E 512 \u4E2A\uFF0C\u5143\u7D20\u5927\u5C0F\u5C0F\u4E8E 64 \u5B57\u8282\uFF09\u6216\u54C8\u5E0C\u8868\u6765\u5B9E\u73B0</p><p>\u4F7F\u7528\u573A\u666F\uFF1A</p><ul><li><strong>\u968F\u673A\u83B7\u53D6\u96C6\u5408\u4E2D\u5143\u7D20</strong>\uFF1A\u62BD\u5956\u7CFB\u7EDF\u3001\u968F\u673A\u70B9\u540D\u7CFB\u7EDF\uFF1BSPOP\uFF1A\u968F\u673A\u83B7\u53D6\u5E76\u79FB\u9664\u5143\u7D20\uFF1BSRANGMEMBER\uFF1A\u968F\u673A\u83B7\u53D6\u5143\u7D20</li><li>\u83B7\u53D6<strong>\u591A\u4E2A\u6570\u636E\u6E90\u505A\u4EA4\u96C6\u5E76\u96C6\u5DEE\u96C6</strong>\u7684\u573A\u666F\uFF1A\u5F97\u76CA\u4E8E Set \u96C6\u5408\u53EF\u4EE5\u8F7B\u677E\u505A\u4EA4\u96C6\u3001\u5E76\u96C6\u3001\u5DEE\u96C6\u7684\u64CD\u4F5C\uFF0C\u5171\u540C\u5173\u6CE8\u3001\u5171\u540C\u597D\u53CB\u70B9\u8D5E\u7684\u573A\u666F\u90FD\u53EF\u4EE5\u6EE1\u8DB3</li></ul><h3 id="zset-\u6709\u5E8F\u96C6\u5408" tabindex="-1"><a class="header-anchor" href="#zset-\u6709\u5E8F\u96C6\u5408" aria-hidden="true">#</a> ZSet \u6709\u5E8F\u96C6\u5408</h3><p>ZSet \u548C Set \u6709\u70B9\u7C7B\u4F3C\uFF0C\u4F46\u662F\u6BCF\u4E00\u4E2A\u5143\u7D20\u90FD\u591A\u4E86\u4E00\u4E2A score \u6743\u91CD\u53C2\u6570\uFF0C\u4F7F\u5F97\u96C6\u5408\u4E2D\u7684\u6570\u636E\u53EF\u4EE5\u6309\u7167 score \u6765\u8FDB\u884C\u6709\u5E8F\u6392\u5E8F\uFF0C\u8FD8\u53EF\u4EE5\u901A\u8FC7 score \u8303\u56F4\u83B7\u53D6\u5143\u7D20\u5217\u8868</p><p>\u5E95\u5C42\u4F7F\u7528\u538B\u7F29\u5217\u8868\uFF08\u5143\u7D20\u5C11\u4E8E 128 \u4E2A\uFF0C\u5143\u7D20\u5927\u5C0F\u5C0F\u4E8E 64 \u5B57\u8282\uFF09\u6216\u8DF3\u8868\u6765\u5B9E\u73B0</p><p>\u4F7F\u7528\u573A\u666F\uFF1A</p><ul><li><strong>\u6EE1\u8DB3\u5927\u591A\u6570\u6392\u5E8F\u573A\u666F</strong>\uFF1A\u6392\u884C\u699C\uFF0C\u5FAE\u4FE1\u6B65\u6570\u6392\u884C\u699C\u7B49</li></ul><h3 id="\u8DF3\u8868" tabindex="-1"><a class="header-anchor" href="#\u8DF3\u8868" aria-hidden="true">#</a> \u8DF3\u8868</h3><p>\u8DF3\u8868\u662F\u5728\u94FE\u8868\u7684\u57FA\u7840\u4E0A\u8FDB\u884C\u7684\u6539\u826F\uFF0C\u5B9E\u73B0\u4E86\u4E00\u79CD\u4E8C\u7EF4\u94FE\u8868\uFF0C\u5934\u8282\u70B9\u662F\u4E00\u4E2A\u6570\u7EC4\uFF0C\u6570\u7EC4\u4E2D\u7684\u5143\u7D20\u7EF4\u62A4\u4E86\u4E00\u4E2A\u6570\u7EC4\uFF0C\u6839\u636E\u8DE8\u5EA6\u5206\u522B\u6307\u5411\u4E0D\u540C\u5C42\u7EA7\u7684\u8282\u70B9\uFF0C\u6BCF\u4E2A\u5C42\u7EA7\u7684\u8282\u70B9\u90FD\u901A\u8FC7\u6307\u9488\u76F8\u4E92\u8FDE\u63A5\u8D77\u6765\uFF1B\u94FE\u8868\u4E2D\u7684\u8282\u70B9\u4E5F\u7EF4\u62A4\u4E86\u4E00\u4E2A\u6570\u7EC4\uFF0C\u5206\u522B\u6307\u5411\u4E0D\u540C\u8DE8\u5EA6\u7684\u4E0B\u4E00\u4E2A\u8282\u70B9</p><p><img src="https://wingbun-notes-image.oss-cn-guangzhou.aliyuncs.com/images/20230602213319.png" alt=""></p><h2 id="redis-\u7EBF\u7A0B\u6A21\u578B" tabindex="-1"><a class="header-anchor" href="#redis-\u7EBF\u7A0B\u6A21\u578B" aria-hidden="true">#</a> Redis \u7EBF\u7A0B\u6A21\u578B</h2><h3 id="redis-\u5355\u7EBF\u7A0B\u6A21\u578B" tabindex="-1"><a class="header-anchor" href="#redis-\u5355\u7EBF\u7A0B\u6A21\u578B" aria-hidden="true">#</a> Redis \u5355\u7EBF\u7A0B\u6A21\u578B</h3><p>Redis \u5355\u7EBF\u7A0B\u6A21\u578B\u662F\u6307\uFF1A<code>\u63A5\u6536\u5BA2\u6237\u7AEF\u8BF7\u6C42 -&gt; \u89E3\u6790\u5BA2\u6237\u7AEF\u8BF7\u6C42 -&gt; \u8FDB\u884C\u6570\u636E\u8BFB\u5199 -&gt; \u54CD\u5E94\u6570\u636E\u7ED9\u5BA2\u6237\u7AEF</code> \u8FD9\u4E2A\u8FC7\u7A0B\u7531 Redis \u7684\u4E00\u4E2A\u7EBF\u7A0B\u5B8C\u6210</p><p>\u4F46\u662F Redis \u8FD8\u662F\u4F1A\u542F\u52A8\u540E\u53F0\u7EBF\u7A0B\u7684\uFF0C\u6BD4\u5982\u5173\u95ED\u6587\u4EF6\u3001AOF \u5237\u76D8\u3001\u91CA\u653E\u5185\u5B58\uFF0C\u56E0\u4E3A\u8FD9\u4E9B\u4EFB\u52A1\u7684\u64CD\u4F5C\u90FD\u662F\u5F88\u8017\u65F6\u7684\uFF0C\u5982\u679C\u653E\u5728\u4E3B\u7EBF\u7A0B\uFF0C\u90A3\u4E48 Redis \u7684\u4E3B\u7EBF\u7A0B\u5F88\u5BB9\u6613\u5BFC\u81F4\u963B\u585E\uFF0C\u65E0\u6CD5\u5904\u7406\u8BF7\u6C42\uFF0C\u6548\u7387\u964D\u4F4E\u3002</p><ul><li><strong>\u5220\u9664\u5927 key \u6570\u636E\u65F6</strong>\uFF0C\u5E94\u8BE5\u4F7F\u7528 unlink key \u547D\u4EE4\uFF0C\u800C\u4E0D\u8981\u76F4\u63A5\u6267\u884C del key \u547D\u4EE4\uFF0C\u56E0\u4E3A\u76F4\u63A5\u5220\u9664\u4F1A\u5728\u4E3B\u7EBF\u7A0B\u4E2D\u6267\u884C\uFF0C\u6548\u7387\u4F4E\uFF0C<strong>\u5E94\u8BE5\u4F7F\u7528 unlink \u6765\u8FDB\u884C\u5F02\u6B65\u5220\u9664</strong></li></ul><h3 id="redis-\u76D1\u542C\u5927\u91CF\u5BA2\u6237\u7AEF\u8FDE\u63A5\u7684\u505A\u6CD5" tabindex="-1"><a class="header-anchor" href="#redis-\u76D1\u542C\u5927\u91CF\u5BA2\u6237\u7AEF\u8FDE\u63A5\u7684\u505A\u6CD5" aria-hidden="true">#</a> Redis \u76D1\u542C\u5927\u91CF\u5BA2\u6237\u7AEF\u8FDE\u63A5\u7684\u505A\u6CD5</h3><p>Redis \u901A\u8FC7 <strong>IO \u591A\u8DEF\u590D\u7528\u5668</strong> \u6765\u76D1\u542C\u6765\u81EA\u5BA2\u6237\u7AEF\u7684\u5927\u91CF\u8FDE\u63A5\uFF08\u6216\u8005\u8BF4\u662F\u76D1\u542C\u591A\u4E2A socket\uFF09\uFF0C\u5F53\u5BA2\u6237\u7AEF\u53D1\u9001\u4E8B\u4EF6\u65F6\uFF0C\u4EA4\u7ED9<strong>\u4E8B\u4EF6\u5206\u53D1\u5668</strong>\u6839\u636E\u4E0D\u540C\u7684\u65F6\u95F4\u7C7B\u578B\u6765\u8C03\u7528\u4E0D\u540C\u7684<strong>\u4E8B\u4EF6\u5904\u7406\u5668</strong></p><p>\u8FD9\u6837\u505A\u7684\u597D\u5904\u662F\uFF1AIO \u591A\u8DEF\u590D\u7528\u4F7F Redis \u53EA\u9700\u8981\u4E00\u4E2A\u7EBF\u7A0B\u5C31\u53EF\u4EE5\u7BA1\u7406\u6BCF\u4E00\u4E2A\u5BA2\u6237\u7AEF\u7684\u8FDE\u63A5\uFF0C\u53EA\u6709\u7B49\u5BA2\u6237\u7AEF\u7684\u6570\u636E\u5230\u8FBE\u540E\uFF0C\u624D\u4E3A\u5176\u670D\u52A1\uFF08\u901A\u8FC7\u4E8B\u4EF6\u5206\u53D1\u5668\u5206\u53D1\u5230\u5177\u4F53\u5904\u7406\u5668\u4E0A\uFF09</p><p><img src="https://wingbun-notes-image.oss-cn-guangzhou.aliyuncs.com/images/20230603161415.png" alt=""></p><h3 id="redis-\u7684\u540E\u53F0\u7EBF\u7A0B" tabindex="-1"><a class="header-anchor" href="#redis-\u7684\u540E\u53F0\u7EBF\u7A0B" aria-hidden="true">#</a> Redis \u7684\u540E\u53F0\u7EBF\u7A0B</h3><p>\u867D\u7136 Redis \u5BF9\u6570\u636E\u7684\u64CD\u4F5C\u4E3B\u8981\u903B\u8F91\u662F\u5355\u7EBF\u7A0B\u6765\u5904\u7406\uFF0C\u4F46\u662F\u5BF9\u4E8E\u4E00\u4E9B\u8017\u65F6\u64CD\u4F5C\uFF0CRedis \u8FD8\u662F\u4F7F\u7528\u4E86\u5176\u4ED6\u5B50\u7EBF\u7A0B\u6765\u534F\u52A9\u5B8C\u6210\u3002</p><p>\u540E\u53F0\u7EBF\u7A0B\u76F8\u5F53\u4E8E\u4E00\u4E2A\u6D88\u8D39\u8005\uFF0C\u751F\u4EA7\u8005\u628A\u8017\u65F6\u4EFB\u52A1\u4E22\u5230\u4EFB\u52A1\u961F\u5217\u4E2D\uFF0C\u6D88\u8D39\u8005\uFF08BIO\uFF09\u4E0D\u505C\u8F6E\u8BE2\u8FD9\u4E2A\u961F\u5217\uFF0C\u62FF\u51FA\u4EFB\u52A1\u5C31\u53BB\u6267\u884C\u5BF9\u5E94\u7684\u65B9\u6CD5\u5373\u53EF\u3002</p><p>\u4E3B\u8981\u6709\u4E09\u4E2A\u540E\u53F0\u7EBF\u7A0B\uFF1A</p><ul><li>\u5173\u95ED\u6587\u4EF6\uFF1A<code>bio_close_file</code> \u540E\u53F0\u7EBF\u7A0B\u76D1\u542C\u5173\u95ED\u6587\u4EF6\u4EFB\u52A1\u961F\u5217\u6765\u91CA\u653E AOF / RDB \u7B49\u8FC7\u7A0B\u4E2D\u4EA7\u751F\u7684\u4E34\u65F6\u6587\u4EF6\u8D44\u6E90</li><li>AOF \u6587\u4EF6\u5237\u76D8\uFF1A<code>bio_aof_fsync</code> \u540E\u53F0\u7EBF\u7A0B\u76D1\u542C AOF \u5237\u76D8\u4EFB\u52A1\u961F\u5217\u8C03\u7528 <code>fsync</code> \u51FD\u6570\u5C06\u7CFB\u7EDF\u5185\u6838\u7F13\u51B2\u533A\u8FD8\u672A\u540C\u6B65\u5230\u5230\u78C1\u76D8\u7684\u6570\u636E\u5F3A\u5236\u5237\u5230\u78C1\u76D8\uFF08 AOF \u6587\u4EF6\uFF09</li><li>\u91CA\u653E\u5185\u5B58\uFF1A<code>bio_lazy_free</code>\u540E\u53F0\u7EBF\u7A0B\u76D1\u542C lazy free \u4EFB\u52A1\u961F\u5217\u91CA\u653E\u901A\u8FC7\u5F02\u6B65\u5220\u9664\u7684\u5927\u5BF9\u8C61\u5360\u7528\u7684\u5185\u5B58\u7A7A\u95F4</li></ul><p><img src="https://wingbun-notes-image.oss-cn-guangzhou.aliyuncs.com/images/20230603161934.png" alt=""></p><h3 id="redis-6-\u4E4B\u524D\u4E3A\u4EC0\u4E48\u4F7F\u7528\u5355\u7EBF\u7A0B" tabindex="-1"><a class="header-anchor" href="#redis-6-\u4E4B\u524D\u4E3A\u4EC0\u4E48\u4F7F\u7528\u5355\u7EBF\u7A0B" aria-hidden="true">#</a> Redis 6 \u4E4B\u524D\u4E3A\u4EC0\u4E48\u4F7F\u7528\u5355\u7EBF\u7A0B</h3><ol><li><strong>CPU \u5E76\u4E0D\u662F\u5236\u7EA6 Redis \u6027\u80FD\u8868\u73B0\u7684\u74F6\u9888\u6240\u5728</strong>\uFF0C\u66F4\u591A\u60C5\u51B5\u4E0B\u662F\u53D7\u5230\u5185\u5B58\u5927\u5C0F\u548C\u7F51\u7EDCI/O\u7684\u9650\u5236\uFF0C\u6240\u4EE5 Redis \u6838\u5FC3\u6A21\u578B\u4F7F\u7528\u5355\u7EBF\u7A0B</li><li>\u4F7F\u7528\u591A\u7EBF\u7A0B\u4F1A\u589E\u52A0\u7CFB\u7EDF\u590D\u6742\u5EA6\uFF0C\u5F15\u5165\u5176\u4ED6\u7EBF\u7A0B\u95EE\u9898\uFF0C\u5982\u52A0\u9501\u3001\u91CA\u653E\u9501\u751A\u81F3\u6B7B\u9501\u5E26\u6765\u7684\u7EBF\u7A0B\u5B89\u5168\u95EE\u9898\uFF0C\u7EBF\u7A0B\u4E0A\u4E0B\u6587\u5207\u6362\u4E5F\u4F1A\u5E26\u6765\u6027\u80FD\u6D88\u8017\uFF0C\u4F7F\u7528\u5355\u7EBF\u7A0B\u6A21\u578B\u7B80\u5355\uFF0C\u7EF4\u62A4\u5BB9\u6613</li></ol><h3 id="redis-6-\u540E\u4E3A\u4EC0\u4E48\u5F15\u5165\u591A\u7EBF\u7A0B" tabindex="-1"><a class="header-anchor" href="#redis-6-\u540E\u4E3A\u4EC0\u4E48\u5F15\u5165\u591A\u7EBF\u7A0B" aria-hidden="true">#</a> Redis 6 \u540E\u4E3A\u4EC0\u4E48\u5F15\u5165\u591A\u7EBF\u7A0B</h3><p>\u9274\u4E8E\u5355\u7EBF\u7A0B\u6A21\u578B\u7684 Redis \u6027\u80FD\u74F6\u9888\u5728\u7F51\u7EDC IO \u4E0A\uFF0CRedis 6 \u5F15\u5165\u591A\u7EBF\u7A0B\u4E3B\u8981\u662F\u63D0\u9AD8\u7F51\u7EDC IO \u7684\u8BFB\u5199\u6027\u80FD\u3002<strong>\u4F46\u662F\u5BF9\u4E8E Redis \u7684\u547D\u4EE4\u6267\u884C\uFF0CRedis \u4F9D\u7136\u662F\u91C7\u7528\u5355\u7EBF\u7A0B\u7684\u65B9\u5F0F\u6267\u884C\u7684</strong></p><p>\u5E76\u4E14\u9ED8\u8BA4\u60C5\u51B5\u4E0B\uFF0CRedis \u7684 IO \u591A\u7EBF\u7A0B<strong>\u53EA\u9488\u5BF9\u53D1\u9001\u76F8\u5E94\u6570\u636E\u6D41\u7A0B</strong>\uFF0C\u5BF9\u4E8E\u5904\u7406\u8BFB\u8BF7\u6C42\u6D41\u7A0B\u8FD8\u9700\u8981\u5728 <code>redis.conf</code> \u914D\u7F6E\u6587\u4EF6\u4E2D\u989D\u5916\u542F\u52A8\uFF1B<strong>\u5B98\u65B9\u63A8\u8350 IO \u591A\u7EBF\u7A0B\u6570 = \u673A\u5668\u6838\u5FC3\u6570 - 1</strong>\uFF0C\u56E0\u4E3A\u4E3B\u7EBF\u7A0B\u4E5F\u662F\u5176\u4E2D\u4E00\u4E2A IO \u7EBF\u7A0B</p><h3 id="\u4E3A\u4EC0\u4E48-redis-\u5355\u7EBF\u7A0B\u6027\u80FD\u4E5F\u8FD9\u4E48\u9AD8" tabindex="-1"><a class="header-anchor" href="#\u4E3A\u4EC0\u4E48-redis-\u5355\u7EBF\u7A0B\u6027\u80FD\u4E5F\u8FD9\u4E48\u9AD8" aria-hidden="true">#</a> \u4E3A\u4EC0\u4E48 Redis \u5355\u7EBF\u7A0B\u6027\u80FD\u4E5F\u8FD9\u4E48\u9AD8</h3><ol><li>Redis \u5927\u90E8\u5206\u64CD\u4F5C\u90FD\u5728\u5185\u5B58\u4E2D\u5B8C\u6210\uFF0C\u5E76\u4E14\u91C7\u7528\u4E86\u9AD8\u6548\u7684\u6570\u636E\u7ED3\u6784\uFF0CRedis \u6027\u80FD\u74F6\u9888\u5F80\u5F80\u4E0D\u5728 CPU\uFF0C\u800C\u5728\u5185\u5B58\u5927\u5C0F\u548C\u7F51\u7EDC IO \u65B9\u9762</li><li>\u5355\u7EBF\u7A0B\u64CD\u4F5C\u53EF\u4EE5\u907F\u514D\u591A\u7EBF\u7A0B\u5E26\u6765\u7684\u95EE\u9898\uFF0C\u6BD4\u5982\u7EBF\u7A0B\u4E0A\u4E0B\u6587\u5207\u6362\u7684\u65F6\u95F4\u6D88\u8017\uFF0C\u5E76\u4E14\u4E0D\u7528\u52A0\u9501\uFF0C\u4E5F\u4E0D\u4F1A\u5BFC\u81F4\u51FA\u73B0\u6B7B\u9501</li><li>Redis \u662F\u91C7\u7528\u4E86 IO \u591A\u8DEF\u590D\u7528\u6A21\u578B\u6765\u5904\u7406\u5927\u91CF\u7684\u5BA2\u6237\u7AEF\u8BF7\u6C42\u7684\uFF0C\u7B80\u5355\u6765\u8BF4\u662F\u4E00\u4E2A\u7EBF\u7A0B\u7BA1\u7406\u591A\u4E2A\u5BA2\u6237\u7AEF\u8FDE\u63A5\uFF0C\u53EA\u8981\u5F53\u5BA2\u6237\u7AEF\u6709\u6570\u636E\u53D1\u9001\uFF0C\u90A3\u4E48\u5C31\u4EA4\u7ED9\u4E8B\u4EF6\u5206\u53D1\u5668\u8BA9\u5177\u4F53\u7684\u4E8B\u4EF6\u5904\u7406\u5668\u54CD\u5E94\u8BF7\u6C42</li></ol><h2 id="redis-\u6301\u4E45\u5316" tabindex="-1"><a class="header-anchor" href="#redis-\u6301\u4E45\u5316" aria-hidden="true">#</a> Redis \u6301\u4E45\u5316</h2><p>Redis \u6027\u80FD\u9AD8\u7684\u4E00\u4E2A\u91CD\u8981\u539F\u56E0\u662F\u6570\u636E\u64CD\u4F5C\u90FD\u653E\u5728\u5185\u5B58\u4E2D\u5904\u7406\uFF0C\u5F53 Redis \u91CD\u542F\u65F6\uFF0C\u4E3A\u4E86\u4FDD\u8BC1\u5185\u5B58\u4E2D\u7684\u6570\u636E\u4E0D\u4E22\u5931\uFF0CRedis \u63D0\u4F9B\u4E86\u6570\u636E\u6301\u4E45\u5316\u673A\u5236\uFF0C\u628A\u6570\u636E\u6301\u4E45\u5316\u5230\u78C1\u76D8\uFF0C\u4FDD\u8BC1\u4E86\u91CD\u542F\u65F6\u80FD\u591F\u4ECE\u78C1\u76D8\u4E2D\u6062\u590D\u539F\u6709\u6570\u636E</p><h3 id="redis-\u63D0\u4F9B\u4E09\u79CD\u6301\u4E45\u5316\u7B56\u7565" tabindex="-1"><a class="header-anchor" href="#redis-\u63D0\u4F9B\u4E09\u79CD\u6301\u4E45\u5316\u7B56\u7565" aria-hidden="true">#</a> Redis \u63D0\u4F9B\u4E09\u79CD\u6301\u4E45\u5316\u7B56\u7565</h3><ul><li><p>RDB \u5FEB\u7167\uFF1A\u5C06\u67D0\u4E00\u65F6\u523B\u7684\u5185\u5B58\u6570\u636E\u4EE5<strong>\u4E8C\u8FDB\u5236</strong>\u7684\u65B9\u5F0F\u5199\u5165\u78C1\u76D8\u3002\u9ED8\u8BA4\u4F1A\u5F00\u542F RDB \u6301\u4E45\u5316\u7B56\u7565\uFF0CRedis \u4F1A fork \u4E00\u4E2A\u5B50\u7EBF\u7A0B\u6765\u6267\u884C\uFF0C\u4E0D\u4F1A\u963B\u585E\u4E3B\u7EBF\u7A0B</p></li><li><p>AOF \u65E5\u5FD7\uFF1A\u6BCF\u6267\u884C\u4E00\u6761<strong>\u5199\u64CD\u4F5C\u547D\u4EE4</strong>\uFF0C\u5C31\u628A\u547D\u4EE4\u8FFD\u52A0\u5230\u65E5\u5FD7\u6587\u4EF6\u4E2D</p><ul><li><p>\u6574\u4F53\u6D41\u7A0B\uFF1A</p><p><img src="https://wingbun-notes-image.oss-cn-guangzhou.aliyuncs.com/images/20230604174756.png" alt=""></p></li><li><p>\u968F\u7740 AOF \u6587\u4EF6\u4E0D\u65AD\u5199\u5165\uFF0CAOF \u6587\u4EF6\u7684\u4F53\u79EF\u4F1A\u8D8A\u6765\u8D8A\u5927\uFF0C\u8FD9\u65F6\u5019\u9700\u8981\u5BF9 AOF \u6587\u4EF6\u8FDB\u884C\u91CD\u5199\uFF0C\u8FBE\u5230\u538B\u7F29\u7684\u76EE\u7684</p></li></ul></li><li><p>\u6DF7\u5408\u6A21\u5F0F\uFF1ARedis 4 \u65B0\u589E\u7684\u7B56\u7565\uFF0C\u7ED3\u5408\u4E86\u4E24\u79CD\u7B56\u7565\u7684\u4F18\u70B9\uFF0C\u628A RDB \u7684\u5185\u5BB9\u5199\u5165\u5230 AOF \u6587\u4EF6\u7684\u5F00\u5934\u5904\uFF0C\u53EF\u4EE5\u5FEB\u901F\u52A0\u8F7D\u5E76\u4E14\u540C\u65F6\u907F\u514D\u4E22\u5931\u8FC7\u591A\u6570\u636E\uFF0C\u7F3A\u70B9\u662F RDB \u90E8\u5206\u662F\u538B\u7F29\u683C\u5F0F\uFF0C\u53EF\u8BFB\u6027\u5DEE</p></li></ul><p>\u5982\u4F55\u9009\u62E9\uFF1A</p><p>\u7531\u4E8E RDB \u6587\u4EF6\u4E00\u822C\u4F1A\u6BD4\u8BB0\u5F55\u6BCF\u6761\u5199\u64CD\u4F5C\u8BED\u53E5\u7684 AOF \u6587\u4EF6\u4F53\u79EF\u5C0F\uFF0CAOF \u8BB0\u5F55\u7684\u662F\u5199\u64CD\u4F5C\u547D\u4EE4\uFF0CRDB \u8BB0\u5F55\u7684\u662F\u5185\u5B58\u6570\u636E\u7684\u5FEB\u7167\uFF0C\u5728\u6570\u636E\u6062\u590D\u65F6\uFF0CRDB \u7684\u7B56\u7565\u6062\u590D\u4F1A\u66F4\u5FEB\u3002</p><p>\u4F46\u662F\u4ECE\u6570\u636E\u5B89\u5168\u6027\u7684\u65B9\u9762\u6765\u8BF4\uFF0C\u56E0\u4E3A RDB \u65E0\u6CD5\u505A\u5230\u5B9E\u65F6\u7684\u6301\u4E45\u5316\uFF0C\u5047\u5982\u628A RDB \u7684\u6301\u4E45\u5316\u7B56\u7565\u914D\u7F6E\u6210\u6BCF\u79D2\u90FD\u505A\u5168\u91CF\u5FEB\u7167\uFF0C\u4E00\u610F\u4E49\u4E0D\u5927\uFF0C\u4E8C\u5BF9 CPU \u8D44\u6E90\u6D88\u8017\u4E5F\u662F\u975E\u5E38\u5927\u7684\uFF0C\u751A\u81F3\u4F1A\u5BFC\u81F4\u5B95\u673A\u3002\u6240\u4EE5 RDB \u7684\u5B9E\u65F6\u6027\u4E0D\u5982 AOF\uFF0C\u90A3\u4E48\u5728\u6570\u636E\u6062\u590D\u4E2D\uFF0CRDB \u6709\u53EF\u80FD\u4F1A\u4E22\u5931\u5B95\u673A\u5230\u6700\u540E\u4E00\u6B21\u6301\u4E45\u5316\u8FD9\u6BB5\u65F6\u95F4\u7684\u6570\u636E\u3002</p><ul><li><strong>\u5982\u679C\u5BF9\u4E8E\u5C11\u91CF\u6570\u636E\u4E22\u5931\u6765\u8BF4\u5F71\u54CD\u4E0D\u5927\u7684\u8BDD\uFF0C\u53EF\u4EE5\u653E\u5FC3\u9009\u62E9 RDB</strong></li><li><strong>\u5982\u679C\u5BF9\u6570\u636E\u5B89\u5168\u6027\u8981\u6C42\u6BD4\u8F83\u9AD8\u7684\u8BDD</strong>\uFF0C\u4E5F\u4E0D\u5EFA\u8BAE\u5355\u72EC\u4F7F\u7528 AOF\uFF0C\u56E0\u4E3A AOF \u6062\u590D\u6570\u636E\u8F83\u6162\uFF0C\u8FD8\u8981\u8003\u8651 AOF \u6587\u4EF6\u81A8\u80C0\u7684\u95EE\u9898\uFF0C<strong>\u63A8\u8350\u4F7F\u7528\u6DF7\u5408\u6A21\u5F0F\u6301\u4E45\u5316\uFF0C\u540C\u65F6\u517C\u987E\u6027\u80FD\u4E0E\u5B89\u5168</strong></li></ul>',80),d=[n];function t(l,o){return e(),s("div",null,d)}var p=i(r,[["render",t],["__file","Redis-interview.html.vue"]]);export{p as default};
